function deleteConfirmation(event){event.preventDefault();Swal.fire({title:'Are you sure?',text:"You won't be able to revert this!",icon:'warning',showCancelButton:true,confirmButtonColor:'#3085d6',cancelButtonColor:'#d33',confirmButtonText:'Yes, delete it!',cancelButtonText:'Cancel'}).then((result)=>{if(result.isConfirmed){document.getElementById('deleteForm').submit();}});}
$(document).ready(function(){$(".preloader").hide();$("#Form").on("submit",function(){$(".preloader").fadeIn();});$("#table").DataTable();});function logoutFunction(event){event.preventDefault();Swal.fire({title:"Sure Want to Logout?",icon:"warning",showCancelButton:true,confirmButtonColor:"#3085d6",cancelButtonColor:"#d33",confirmButtonText:"OK"}).then((result)=>{if(result.isConfirmed){$("#logoutform").submit();}});};